'use strict';
/*global ipc: true*/

var ipc = angular.module('ipc', ['ipc.filters', 'ui.bootstrap', 'ui.select2', 'ngSanitize', 'nouislider']);

ipc.config(['$httpProvider', function ($httpProvider) {
	$httpProvider.defaults.headers.post['Content-Type'] = 'application/x-www-form-urlencoded; charset=UTF-8';
}]);
