ipc.controller('productsList', ['$scope', '$http', '$element', 'BasketStatus', 'listStatus', '$sce', '$timeout', function ($scope, $http, $element, BasketStatus, listStatus, $sce, $timeout) {
	$scope.basket = BasketStatus;
	$scope.model = listStatus.list;
	$scope.setList = listStatus.setList;
	$scope.filters = listStatus.filters;
	$scope.pagination = listStatus.pagination;
    $scope.service = listStatus.service;
	$scope.formStatus = 'ready';


	$scope.inBasket = false;
/*	var href = document.location.href.split('#');
	if (href[1] === 'quantity') {
		$scope.activeCardTab1 = true;
	}*/
	$scope.initList = function () {
		var parameters = GLOBAL_LIST;
		for (var item in parameters.LIST) {
			$scope.model[item] = parameters.LIST[item];
		}
		//$scope.model = parameters.LIST;

		$scope.pagination = parameters.PAGINATION;

		for (var item in parameters.FILTERS) {
			$scope.filters[item] = parameters.FILTERS[item];
		}
	};
	$scope.inHtml = function (text) {
		return $sce.trustAsHtml(text);
	};

    $scope.setConfig = function(tab){
	    var $delta = 110;
	    if ($('.box-top').hasClass( "fixed" ))
		    $delta = 40;
        for (var item in $scope.activeCardTab) {
            $scope.activeCardTab[item] = false;
        }
        $scope.activeCardTab[tab] = true;

        $('html, body').animate({
			    scrollTop: $('.tabs').offset().top - $delta+ "px"}
		    ,"slow");
    }
    
	/************************************************
	Одна функция для обновления опций и добавления в корзину
	************************************************/
	$scope.updateForm = function (action, id, count) {
		var address = '?changeOptions';
		var serialize = 'ACTION=' + action + $scope.serializeOptions('');
		if (count) {
			serialize = serialize.replace(/(COUNT=)[\w]*/g, '$1' + count);
		}
		$scope.formStatus = 'loading';
		$http.post(address, serialize).success(function (data) {
			$scope.formStatus = 'ready';
			$scope.updateModels(data);
		});
	};

	/************************************************
	Функция перевода активного состояния в коунтер
	************************************************/
	$scope.setActiveOption = function (group, subgroup) {
		$scope.service.options[group].active[0] = subgroup;
		for (var item in $scope.service.options[group]) {
			if ($scope.service.options[group].active[0] !== item) {
				$scope.service.options[group][item].COUNT = '';
			}
		}
	};

    $scope.setPageCount = function(){
        var address = '?getPriceList';
		var serialize = {
			ACTION: 'SORT',
			FILTER: $scope.filters.filter,
			sort: $scope.filters.sort,
			order: $scope.filters.order,
            page: $scope.filters.NavPageSize
		};
		$http.post(address, serialize).success(function (data) {
			$scope.formStatus = 'ready';
			$scope.updateModels(data, 'replaceList');
		});
        return false;
    }
    $scope.getPage = function(pageNum){
        var address = '?getPriceList&PAGEN_' + $scope.filters.NavNum + '=' + pageNum;
		var serialize = {
			ACTION: 'SORT',
			FILTER: $scope.filters.filter,
			sort: $scope.filters.sort,
			order: $scope.filters.order,
            page: $scope.filters.NavPageSize
		};
		$http.post(address, serialize).success(function (data) {
			$scope.formStatus = 'ready';
			$scope.updateModels(data, 'replaceList');
		});
        return false;
    }
	/************************************************
	Проверка добавления товара в корзину
	************************************************/
	$scope.checkAddBasket = function () {
		var curModel = $scope.service.currentModel;
		if (!($scope.model[curModel].COUNT)) {
			return true;
		}
		if ($scope.service.options) {
			for (var item in $scope.service.options) {
				var active = $scope.service.options[item].active;
				for (var option = 0; option < active.length; option++) {
					var activeOption = $scope.service.options[item][active[option]];
					if (activeOption) {
						if (!(activeOption.COUNT)) {
							return true;
						}
					}
				}
			}
		}
	};

	/************************************************
	счетчик количества
	@$scope.service.defaultCount - по-умолчанию равен 1
	************************************************/
	$scope.changeCount = function (elem, num) {
		var currentCount = parseFloat(elem) + parseFloat(num);
		if (!currentCount || (currentCount < $scope.service.defaultCount)) {
			return $scope.service.defaultCount;
		} else {
			return currentCount;
		}
	};
    
	/************************************************
	Условие показа ошибки для коунтера
	************************************************/
	$scope.counterError = function (group, option) {
		if (($scope.service.options[group][option].COUNT === '') && ($scope.service.options[group].active.indexOf(option) >= 0)) {
			return true;
		} else {
			return false;
		}
	};


	/************************************************
	Обновление данных после запроса на сервер
	************************************************/
	$scope.updateModels = function (data, replace) {
		if (data.LIST) {
            for(var item in $scope.model){
                if(!data.LIST[item])
                    delete $scope.model[item];
            }
            for (var item in data.LIST) {
                $scope.model[item] = data.LIST[item];
            }
		}

		if (data.PAGINATION) {
			$scope.pagination = data.PAGINATION;
		}

		if (data.FILTERS) {
			for (var itemF in data.FILTERS) {
				$scope.filters[itemF] = data.FILTERS[itemF];
			}
		}

		if (data.OPTIONS) {
			$scope.service.optionsSumm = data.OPTIONS.SUMM;
			for (var item1 in $scope.service.options) {
				for (var inner1 in data.OPTIONS.LIST[item1]) {
					for (var params in data.OPTIONS.LIST[item1][inner1]) {
						$scope.service.options[item1][inner1][params] = data.OPTIONS.LIST[item1][inner1][params];
					}
				}
			}
		}
        
		if (data.setList) {
			if (replace === 'replaceList') {
				$scope.setList = data.setList;
			} else {
				for (var item in $scope.setList) {
					for (var inner in data.setList[item]) {
                        for (var subinner in data.setList[item][inner]) {
                            for (var subsubinner in data.setList[item][inner][subinner]) {
                                $scope.setList[item][inner][subinner][subsubinner] = data.setList[item][inner][subinner][subsubinner];
                            }
                            //$scope.setList[item][inner][subinner] = data.setList[item][inner][subinner];
                        }
						//$scope.setList[item][inner] = data.setList[item][inner];
					}
				}
			}
		}
        
		if (data.setOption) {
			for (var outer in data.setOption) {
				$scope.option[outer] = data.setOption[outer];
			}
		}
        
        if(data.STAR){
            $scope.service.showStar = true;
        }

		if (data.BASKETSTATUS) {
			/**********************************************
			Статус здесь выполняет двойную роль:
			Если есть setsStatus - мы в наборах, и BASKETSTATUS - это кличество в элементов в наборе
			Если нет setsStatus - мы в корзиине, и BASKETSTATUS - это кличество в элементов в корзине
			**********************************************/
			/*if ($scope.option && $scope.option.setsStatus) {
				$scope.option.setsStatus = data.BASKETSTATUS;
			} else {*/
				$scope.initBasket(data.BASKETSTATUS);
			//}
		}

		if (data.status === 'done') {
			$scope.inBasket = true;
		}
	};
	/************************************************
	Служебные функции.
	************************************************/
	$scope.serialize = function (arr) {
		var serialize = '';
		for (var item in arr) {
			serialize += item + '=' + arr[item] + '&';
		}
		return serialize.substr(0, serialize.length - 1);
	};

	$scope.serializeOptions = function (addr) {
		if ($scope.service.currentModel) {
			addr += '&COUNT=' + $scope.model[$scope.service.currentModel].COUNT;
		}
		if ($scope.service.options) { // Если существуют опции
			for (var item in $scope.service.options) { // Идем по граппам опций
				var currIDs = $scope.service.options[item].active; // Массив с id-опций
				for (var i = 0; i < currIDs.length; i++) { // Проходим по массиву
					if (currIDs[i]) { // Страхуюсь, если вдруг поподётся пустой элемент
						addr += '&OPTION[' + item + '][]=' + currIDs[i];
						if (currIDs[i] !== 'false') { // false - значит ничего  не выбрано. И количества у "ничего" быть не может
							var currCOUNT = $scope.service.options[item][currIDs[i]].COUNT;
							addr += '&OPTION[' + currIDs[i] + '][COUNT]=' + currCOUNT;
						}
					}
				}
			}
		}
		return addr;
	};
	$scope.initBasket = function (data)  {
		for (var item in data) {
			$scope.basket[item] = data[item];
		}
	};

	/************************************************
	Копирование одного параметра в другой без наследования
	************************************************/
	$scope.copyScope = function (elem, newBind) {
		$scope[newBind] = {};
		for (var item in $scope[elem]) {
			$scope[newBind][item] = {};
			for (var inner in $scope[elem][item]) {
				$scope[newBind][item][inner] = $scope[elem][item][inner];
			}
		}
	};
}]);
