ipc.controller('myProductsList', ['$scope', '$http', 'listStatus', 'ItemStatus', function ($scope, $http, listStatus, ItemStatus) {
	$scope.data = listStatus.favList;
	$scope.status = ItemStatus;
	$scope.formStatus = 'ready';
	$scope.updateItemStatus = function (id, action, removeFromSet) {
		var address = '?updateCat';
		var serialize = {
			ACTION: action,
			PRODUCTID: id,
		};
		$http.post(address, serialize).success(function (data) {
			$scope.formStatus = 'done';
            if(action != "COMPARE")
                $scope.model[id][action] = !$scope.model[id][action];
			if (removeFromSet) {
				$scope.model[id].set = !$scope.model[id].set;
			}
            //console.log(listStatus);
            if(data.favList)
                $scope.initData(data.favList);
            if(data.ItemStatus)
                $scope.initStatus(data.ItemStatus);
                
		});
	};
	/************************************************
	Служебные функции.
	************************************************/
	$scope.initStatus = function (data)  {
        for(var item in $scope.data){
            if(!data[item])
                delete $scope.status[item];
        }
		for (var item in data) {
			$scope.status[item] = data[item];
		}
	};
	$scope.initData = function (data)  {
        for(var item in $scope.data){
            if(!data[item])
                delete $scope.data[item];
        }
		for (var item in data) {
			$scope.data[item] = data[item];
		}
	};
}]);
