ipc.controller('filterModels', ['$scope', '$http', '$element', '$timeout', 'listStatus', function ($scope, $http, $element, $timeout, listStatus) {
	$scope.model = {};
	$scope.activeSlider = '';
	$scope.showBrands = 4;
	$scope.limitShowBrands = $scope.showBrands;
	$scope.status = 'ready';
	$scope.showReset = false;
    $scope.ajaxStackCount = [0, 0];
    $scope.ajaxStack = {};
    
	$scope.info = {
		count: 0,
		link: ''
	};

	$scope.initFilter = function () {
		listStatus.filters.filter = angular.copy($scope.model);
	};

	/*$scope.brandsShow = function (list) {
		if ($scope.limitShowBrands === list.length) {
			$scope.limitShowBrands = $scope.showBrands;
		} else {
			$scope.limitShowBrands = list.length;
		}
	};*/

	$scope.update = function (slider) {
		if (slider) {
			$scope.activeSlider = slider;
		}
        var myGet = $scope.configureGET();
        $scope.ajaxStackCount[0]++;
        
		$scope.status = 'loading';
		$http.post($element.attr('action'), myGet).success(function (data) {
            $scope.ajaxStackCount[1]++;
            $scope.ajaxStack[myGet] = data;
			$scope.showReset = true;
            if ($scope.ajaxStackCount[0] == $scope.ajaxStackCount[1]) {
                $scope.updateModels();
            }
		}).error(function(){
            $scope.ajaxStackCount[1]++;
        });
	};
    
	/*$scope.reset = function () {
		$scope.showReset = false;
		$scope.status = 'loading';
		$http.post($element.attr('action'), 'reset=true&update_filter=1').success(function (data) {
			$scope.updateModels(data);
		});
	};*/
    
	$scope.updateModels = function () {
        var data = $scope.ajaxStack[$scope.configureGET()];
		for (var item in data.filters) {
            data.filters[item].collapse = $scope.model[item].collapse;
			$scope.model[item] = data.filters[item];
		}
		$timeout(function () {
			$scope.info.count = data.count;
			$scope.info.link = $element.serialize();
			$scope.status = 'done';
		}, 100);
	};
    
    $scope.configureGET = function() {
        return ($element.serialize() + '&update_filter=1');
    }
}]);

