ipc.directive('validateForm', ['$http', function ($http) {
	return function (scope, elm, attrs) {
		var options = {
			success: function (data) {
				if (typeof data === 'string') {
					data = JSON.parse(data);
				}
				scope.validateFormData = data; // Засовываем в контроллер данные из формы
				if (data.errors === 1) {
					if (data.fieldsErrors) {
						$.map(data.fieldsErrors, function (val, i) {
							$('[name="' + i + '"]', elm)
								.addClass('error')
								.after('<div class="form-control-error">' + val + '</div>')
								.parent().addClass('error');
						});
					}

					if (data.formError) {
						elm.append('<div class="formError">' + data.formError + '</div>');
					}

				} else {
					if (attrs.exec) {
						/*jslint evil: true */
						eval('scope.' + attrs.exec);
					}

					if (data.url) {
						location.href = data.url;
					}
					if (data.submit) {
						scope.formSubmit = true;
						elm.submit();
					}
					if (data.successText) {
						elm.html('<div class="successForm">' + data.successText + '</div>');
					}
				}
			}
		};

		elm.submit(function () {
			if (!scope.formSubmit) {
				$('.form-control-error', elm).remove();
				$('.formError', elm).remove();
				$('.error', elm).removeClass('error');

				if (attrs.validateForm === 'files') {
					$(this).ajaxSubmit(options);
				} else {
					$http({
						method: elm.attr('method'),
						url: elm.attr('action'),
						data: elm.serialize()
					}).success(options.success);
				}
				return false;
			}
		});
	};
}]);

