ipc.directive("scrollPane", ['$timeout', function($timeout) {
    return {
        restrict: 'A',
        transclude: true,
        template: '<div class="scroll-pane" ng-transclude></div>',
        link: function($scope, $elem, $attrs) {
            var config, fn;
            config = {};
            if ($attrs.scrollConfig) {
                config = $scope.$eval($attrs.scrollConfig);
            }
            
            fn = function() {
                jQuery("#" + $attrs.id).jScrollPane(config);
                return $scope.pane = jQuery("#" + $attrs.id).data("jsp");
            };
            if ($attrs.scrollTimeout) {
                $timeout(fn, $scope.$eval($attrs.scrollTimeout));
            } else {
                fn();
            }
            $scope.$watchCollection('model', function() {
                 if ($scope.pane) {
                    if ($attrs.scrollTimeout) {
                        $timeout(function(){
                            $scope.pane.destroy();
                            fn();
                        }, $scope.$eval($attrs.scrollTimeout));
                    } else {
                        $scope.pane.destroy();
                        fn();
                    }
                }
            });
        }
    };
}]);
