ipc.directive('compare', [function () {
	return function (scope, elm) {
		var elementsHeight = [];
		var elemsCount = 4;
		$.each($('.box-compare .info .list div'), function (key, value) {
			elementsHeight[key] = $(value).outerHeight();
		});

		if ($('#compareSlide>.item').length <= elemsCount) {
			$('#compareSlide').addClass('small');
			elemsCount = $('#compareSlide>.item').length;
		}

		$('#compareSlide').cycle({
			fx: 'carousel',
			slides: '> .item',
			timeout: 0,
			carouselVisible: elemsCount,
			carouselFluid: true,
			allowWrap: false
		});


		$.each($('#compareSlide .cycle-carousel-wrap .cycle-slide'), function (keyS, valueS) {
			$.each($('.list>div', $(valueS)), function (key, value) {
				var h = $(value).outerHeight();
				if (h > elementsHeight[key]) {
					elementsHeight[key] = h;
				}
			});
		});
		$.each($('.box-compare .info .list div'), function (key, value) {
			$(value).css('height', elementsHeight[key] - 2);
			$.each($('#compareSlide .cycle-carousel-wrap .cycle-slide'), function (keyS, valueS) {
				$('.list>div:eq(' + key + ')', $(valueS)).css('height', elementsHeight[key] - 2);
			});
		});


		$('.list .item', elm).hover(function () {
			var index = $(this).index();
			for (var i = 0; i < $('.list', elm).length; i++) {
				$('.list:eq(' + i + ') div:eq(' + index + ')', elm).addClass('hover');
			}
		}, function () {
			var index = $(this).index();
			for (var i = 0; i < $('.list', elm).length; i++) {
				$('.list:eq(' + i + ') div:eq(' + index + ')', elm).removeClass('hover');
			}
		});

		$('.viewParametsSelect li', elm).click(function (e) {
            e.preventDefault();
			$('.viewParametsSelect li', elm).removeClass('active');
			$(this).addClass('active');
			if ($(this).is('.all')) {
				$('.list .equal', elm).removeClass('close');
			} else if ($(this).is('.different')) {
				$('.list .equal', elm).addClass('close');
			}
		});
		$('.remove', elm).click(function () {
			$($(this).parents('.item')[0]).remove();
			if ($('#compareSlide .cycle-carousel-wrap>.item').length <= $('#compareSlide').data('cycle-carousel-visible')) {
				$('#compareSlide .cycle-prev, #compareSlide .cycle-next').remove();
				$('#compareSlide').cycle('goto', 0);
			}
			if ($('#compareSlide .cycle-carousel-wrap>.item').length === 0) {
				setTimeout(function(){
                    location.reload();
                }, 100);
			}
		});
	};
}]);
