ipc.directive('infinitePagination', ['$http', '$compile', function ($http, $compile) {
    return function ($scope, $elem, $attrs){
        var $href = $attrs.href,
            $parent = $elem.parents('.box-infinite-container');
        $elem.click(function(e){
            e.preventDefault();
            $elem.addClass("animate");
            $http.post($href).success(function (data) {
                if(data.content){
                    $parent.find($attrs.ajaxContent).append($compile(data.content)($scope));
                }
                if(data.records){
                    $parent.find($attrs.recordsContent).html(data.records);
                }
                if(data.href){
                    $href = data.href;
                    $elem.attr("href", $href);
                }
                else{
                    $elem.remove();
                }
                $elem.removeClass("animate");
            });
        });
    };
}]);
