ipc.directive('draggable', [function () {
	return function (scope, elm, attr) {
        var size = elm.find('.slide').length,
            widthItem = elm.find('.slide').width() + 14,
            $draginterval,
            $hover = false;
        
        function setDragInterval(){
            clearInterval($draginterval);
            $draginterval = setInterval(function(){
                var $step = $dragDealer.getStep();
                if($step[0] == 4)
                    $step[0] = 0;
                $dragDealer.setStep($step[0] + 1, $step[1], true);
            }, 8000);
        }
        
        elm.find('.handle').css('width', widthItem * size);
        
        var $dragDealer = new Dragdealer(attr.draggable, {
            steps: size-3,
            speed: 0.3,
            loose: true,
            requestAnimationFrame: true,
            dragStartCallback: function(){
                clearInterval($draginterval);
            },
            dragStopCallback: function(){
                setDragInterval();
            }
        });
        
        elm.hover(function(){
            clearInterval($draginterval);
            $hover = true;
        }, function(){
            if($hover)
                setDragInterval();
            $hover = false;
        });

        setDragInterval();
	};
}]);
